  false,\n\t\"url\": null,\n\t\"notes\": \"In June 2014, WSI, a Quantum Spatial Inc.
  (QSI) company, was contracted by the Puget Sound LiDAR Consortium (PSLC) to collect
  Light Detection and Ranging (LiDAR) data for the Washington Department of Natural
  Resources (WA DNR) Lands in western Washington. Data were collected to aid the WA
  DNR in assessing the topographric and geophysical properties of the study area.
  Acquisition of the three separate areas were completed between December 2014 and
